/p>\n\n\n\n<p>If you order to EU, we give you 100% guarantee of safe delivery to specified place because there are no border controls within EU. Shipping to other countries includes risk of interception by customs. We do our best to reduce this risk. We use a good stealth to avoid detection. Pistols are taken apart and hidden inside power tool. Rifles are taken apart and shipped within bigger appliances. You will get manual how to assemble parts together. But if there is a delay and you suspect controlled delivery, then contact us immediately. We guarantee full refund if gun won’t be delivered.</p>\n\n\n\n<p><strong>Which gun for beginner? </strong></p>\n\n\n\n<p>If you buy your first gun, we recommend <a href=\"http://y3uqa5umvziqedr6ox3io7qx4o5kf635s5qnhdbmzi2ws3s5eaitwvid.onion/?product=glock-19-gen-5\" data-type=\"URL\" data-id=\"http://y3uqa5umvziqedr6ox3io7qx4o5kf635s5qnhdbmzi2ws3s5eaitwvid.onion/?product=glock-19-gen-5\">Glock</a> because this is a complete beginner-friendly and well-performance pistol. </p>\n\n\n\n<p><strong>How to pay for guns? </strong></p>\n\n\n\n<p>You need bitcoins or monero. </p>\n\n\n\n<p><strong>Can I pay with credit card? </strong></p>\n\n\n\n<p>No. This would fuck both sides of transaction. </p>\n\n\n\n<p><strong>How to buy bitcoins? </strong></p>\n\n\n\n<p>You can buy bitcoins without revealing your identity for cash, gift cards or bank transfer in many P2P exchanges like Bisq, LocalBitcoins or HodlHold. If you have no experience with cryptocurrencies, we recommend major exchanges like Binance or Coinbase, PayPal, Paxful, Cashapp. Other safe option is to buy bitcoins in ATM if there is one in your city. Make sure it doesn&#8217;t require scanning your ID. You will also need to install mobile wallet on your phone to store and spend your bitcoins, e.g. Coinomi, Exodus. Buy more bitcoins than you need to pay because every transaction costs small network fees. </p>\n\n\n\n<p><strong>How to avoid getting caught? </strong></p>\n\n\n\n<p>There is very low risk of getting caught. We strongly encrypt all information you provide and remove it after completing your order. We also use high-quality stealth to avoid guns detection by customs. To stay safer, follow additional rules:</p>\n\n\n\n<ol><li>Use latest version of Tor Browser</li><li>Don&#8217;t order guns to your workplace</li><li>Don&#8217;t tell anyone about your darknet activity</li></ol>\n\n\n\n<p><strong>How long is shipping time? </strong></p>\n\n\n\n<p>Standard shipping is free and is from 9 to 18 days depending on location.<br>Overnight shipping costs $40 and is from 1 to 3 days depending on location. Tracking number is given with every shipment you purchase from us.</p>\n\n\n\n<p><strong>Is there any return policy? </strong></p>\n\n\n\n<p>We will try our best to resolve an issue with an order. If you have a problem, speak to us. We offer a full money-back guarantee for all purchases made in our store! If you are not satisfied with the product that you have purchased from us, you can get your money back any time! You are eligible for a full reimbursement within 14 calendar days of your purchase. </p>\n\n\n\n<p><strong>Will you give me discount? </strong></p>\n\n\n\n<p>For large number of weapons contact us at <a href=\"mailto:torgunsammo@onionmail.org\" data-type=\"mailto\" data-id=\"mailto:torgunsammo@onionmail.org\">torgunsammo@onionmail.org</a> for more details. </p>\n\n\n\n<p><strong>How can I contact you? </strong></p>\n\n\n\n<p>If you have any questions, contact us at <a href=\"mailto:torgunsammo@onionmail.org\" data-type=\"mailto\" data-id=\"mailto:torgunsammo@onionmail.org\">torgunsammo@onionmail.org</a>.</p>\n\n\n\n<p class=\"has-text-align-center has-large-font-size\">Public key</p>\n\n\n\n<p class=\"has-text-align-center has-small-font-size\">&#8212;&#8211;BEGIN PGP PUBLIC KEY BLOCK&#8212;&#8211; </p>\n\n\n\n<p class=\"has-text-align-center has-small-font-size\">mQENBGFQwgkBCADGvA6ujgZTFaN/wzVxt+ie3z+41jVZC9EPump4Pmp4jI8TXUej /