ey will deliver firearms to your house or drop the package at specific place.</dd>\r\n\r\n<dt>How safe is it?</dt>\r\n<dd>If you order to EU, we give you 100% guarantee of safe delivery to specified place because there are no border controls. Shipping to other countries includes risk of interception by customs. We do our best to reduce this risk. We use a good stealth to avoid detection. Pistols are taken apart and hidden inside power tool. Rifles are taken apart and shipped within bigger appliances. You will get manual how to assemble parts together. But if there is a delay and you suspect controlled delivery, then contact us immediately.</dd>\r\n\r\n<dt>Which gun for beginner?</dt>\r\n<dd>If you buy your first gun, we recommend <a href=\"/glock-19-gen-5-9mm\">Glock</a> because this is a complete beginner-friendly and well-performant pistol.</dd>\r\n\r\n<dt>How to pay for guns?</dt>\r\n<dd>You need bitcoins or monero.</dd>\r\n\r\n<dt>Can I pay with credit card?</dt>\r\n<dd>No. This would fuck both sides of transaction.</dd>\r\n\r\n<dt>How to buy bitcoins?</dt>\r\n<dd>You can buy bitcoins without revealing your identity for cash, gift cards or bank transfer in many P2P exchanges like Bisq, LocalBitcoins or HodlHold. If you have no experience with cryptocurrencies, we recommend major exchanges like Binance or Coinbase.<dd>\r\n<dd>Other safe option is to buy bitcoins in ATM if there is one in your city. Make sure it doesn\'t require scanning your ID. You will also need to install mobile wallet on your phone to store and spend your bitcoins, e.g. Coinomi, Exodus.</dd>\r\n<dd>Buy more bitcoins than you need to pay because every transaction costs small network fees.</dd>\r\n<dd><p><a href=\"/bitcoin\" class=\"button true-button\"><i class=\"fas fa-graduation-cap\"></i> Learn how to buy crypto</a></p></dd>\r\n\r\n<dt>How to avoid getting caught?</dt>\r\n<dd>There is very low risk of getting caught. We strongly encrypt all information you provide and remove it after completing your order. We also use high-quality stealth to avoid guns detection by customs. To stay safer, follow additional rules:<ol><li>Use latest version of Tor Browser</li><li>Don\'t order guns to your workplace</li><li>Don\'t tell anyone about your darknet activity</li></ol></dd>\r\n\r\n<dt>How long is shipping time?</dt>\r\n<dd>Standard shipping is free and is from 3 to 10 days depending on location.<br>Overnight shipping costs $30 and is from 1 to 3 days depending on location.</dd>\r\n\r\n<dt>Is there any return policy?</dt>\r\n<dd>We will try our best to resolve an issue with an order. If you have a problem, speak to us. We offer a full money-back guarantee for all purchases made in our store. If you are not satisfied with the product that you have purchased from us, you can get your money back. You are eligible for a full reimbursement within 14 calendar days of your purchase.</dd>\r\n\r\n<dt>Will you give me discount?</dt>\r\n<dd>For large number of weapons contact us at <a href=\"mailto:torguns@dnmx.org\">torguns@dnmx.org</a> for more detals.</dd>\r\n\r\n<dt>How can I contact you?</dt>\r\n<dd>If you have any questions, contact us at <a href=\"mailto:torguns@dnmx.org\">torguns@dnmx.org</a>.</dd></dl>\r\n	</section>\r\n	<section>\r\n		<h3>Public key</h3>\r\n		<pre class=\"pubkey\">-----BEGIN PGP PUBLIC KEY BLOCK-----\r\n\r\nmQENBGFQwgkBCADGvA6ujgZTFaN/wzVxt+ie3z+41jVZC9EPump4Pmp4jI8TXUej\r\n/D6aw4f/lgydL8Z3mUOh/+RhIqb24hZGSjv7NtgH/kFFtWISK+WeFT6slNM2pDet\r\nNbBPp/0uhuSppSG7kx6Zs2Cgvkd0blvlLrOszJRnoVlscVtrGq1wHsnDuNCo8376\r\nvBaJwVJpPN1Gi/AEPYmKRnejDZuz7zlGFIQmLuzvpz5Vai1Ytdu3wvMsGI0HcoYo\r\niuB53idjeKui2+PTqdm/ethkTQ8ccNoUTx51+MUSuBDwrS7ugZXYuWV9xddjb2/U\r\nG9s19/U8vulUzEjUQL0XHM/4t8OHrQ6vDwJjABEBAAG0G1RvciBHdW5zIDx0b3Jn\r\ndW5zQGRubXgub3JnPokBTgQTAQoAOBYhBDhPz+F10rlyWF64Y1j+GZoXGIuOBQJh\r\nUMIJAhsDBQsJCAcDBRUKCQgLBRYCAwEAAh4BAheAAAoJEFj+GZoXGIuOjd4H/RVY\r\nfBTu8tEdkXaMJ/VgBCSQQblR58AFPoUAeVTllIZcmhTT4U0XEP525zc5Y9/u7EZJ\r\nxBwCdDKHc+5fhKhcPWQR39ItuXUgOJsInXWsG5