replenished with a wide\n          range of new options, tailored to suit your specific requirements. Our shelves have been restocked with an\n          assortment of products that offer enhanced functionality, versatility, and features to meet your diverse\n          needs.</p>\n      </div>\n    </div>\n  </div>\n\n  <div class=\"p-8\">\n    <input type=\"text\" class=\"w-full p-2 border rounded\" id=\"searchInput\" placeholder=\"Looking for something?\">\n  </div>\n\n  <div class=\"grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4 p-8\" id=\"productContainer\">\n    \n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/waltherpp.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">Walther PP Pistol</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 1200 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.0393499 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Genuine post war german Walther made, Walther PP pistol, chambered in .380, the slim profile of this pistol suits concealment quite well. Nickle finish aids in corrosion protection while adding some flair. Magazine holds 8 rounds, additional magazines and ammunition also available</p>\n      <a href=\"order.php?item=8983598375645445\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/AR10.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">AR-10 Rifle</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 4000 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.131166334 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Genuine and all original Armalite manufactured AR-10 rifle, chambered for the 7.62x51 cartridge, this rifle can also safely handle .308 winchester ammunition as well. This original configuration had been trialed by many countries as a frontline service rifle, such as Sweden. 20 round magazine capacity, optics and additional magazines also available..</p>\n      <a href=\"order.php?item=7477279964247972\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/svd.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">Dragunov Rifle</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 6000 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.196749501 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">The big, the bad, the infamous dragunov. This is a TRUE russian made SVD sniper rifle, chambered in the over century long service running cartridge, 7.62x54r. This Rifle is capable of sub-moa accuracy groups and carries a reputation all of its own dating back to the vietnam war. Many stories about this rifle during the 80s russian invasion of afghanistan. This example is NEW and UNFIRED. ARMOR PIERCING AMMUNITION AVAILABLE FOR THIS RIFLE</p>\n      <a href=\"order.php?item=3392369995954434\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/luger.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">Luger Pistol</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 3500 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.114770543 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Original German made luger, chambered in 7.65×21mm Parabellum, this is a very rare classic made available to the discernible collector. Or those who are seeking style.</p>\n      <a href=\"order.php?item=5777727846362925\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/fal.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">FN FAL Rifle</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 3000 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.098374751 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Known as the right arm of the free world, the FN FAL has seen service world wide, even going against itsself during the Falklands war, chambered in 7.62x51 nato but can handle .308 winchester without issue. Shown with optional scope. This model is brazilian made produced under license from FN by Imbel.</p>\n      <a href=\"order.php?item=5398746254434422\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/tantalak74.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">Tantal AK-74 Rifle</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 2500 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.081978959 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Needs no introduction whatsoever, The AK. This one is polish made, and chambered in 5.45x39, less recoil and more velocity and better penetration. More reliable and accurate than its older 7.62x39 brothers.</p>\n      <a href=\"order.php?item=5486476543756845\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/beretta.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">MOD70S Beretta Pistol</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 1100 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.036070742 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Beretta pistols are quite known, this is a MOD70S and chambered in .380 making a nice concealment option for those lingering the unforgiving streets. Italian made, of course.</p>\n      <a href=\"order.php?item=5477383227488377\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>\n    <div class=\"bg-white shadow p-4 rounded\">\n      <img src=\"static/images/colt38super.jpg\" alt=\"Item image\" class=\"w-full h-32 object-cover mb-2 rounded\">\n      <h2 class=\"text-xl font-bold mb-2\">Colt 1911 38 Super</h2>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-dollar-sign\"></i> 2000 USD</p>\n      <p class=\"text-gray-700 mb-2\"><i class=\"fa-solid fa-bitcoin-sign\"></i> 0.065583167 BTC</p>\n      <hr class=\"dark mb-2\" />\n      <p class=\"text-gray-700 mb-2\">Classic and LEGIT COLT 1911, this one is chambered in the .38 super cartridge, a round with a cult following among those south of the border. Excellent trigger pull typical of classic original colt 1911s.</p>\n      <a href=\"order.php?item=7848863828697753\"><button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700\">Buy Now</button></a>\n    </div>  </div>\n\n  <div class=\"p-8 flex flex-col md:flex-row md:justify-center\">\n    <button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700 mb-2 md:mr-2\"><i class=\"fa-solid fa-arrow-left\"></i></button>\n    <button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700 mb-2 md:mr-2\">1</button>\n    <button class=\"px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-700 mb-2 md:mr-2\"><i class=\"fa-solid fa-arrow-right\"></i></button>\n  </div>\n\n  <footer class=\"bg-blue-500 p-4 text-white text-center\">\n    Brought to you by the Gulf Cartel.\n  </footer>\n\n  <script>\n    const searchInput = document.getElementById(\'searchInput\');\n    const productContainer = document.getElementById(\'productContainer\');\n    const products = productContainer.getElementsByClassName(\'bg-white\');\n\n    searchInput.addEventListener(\'keyup\', function(event) {\n      const userInput = event.target.value.toLowerCase();\n\n      for (let i = 0; i < products.length; i++) {\n        const productTitle = products[i].querySelector(\'h2\').textContent.toLowerCase();\n        const productDescription = products[i].querySelector(\'p:last-of-type\').textContent.toLowerCase();\n        const productPrice = products[i].querySelector(\'p:nth-of-type(2)\').textContent.toLowerCase();\n\n        if (productTitle.includes(userInput) || productDescription.includes(userInput) || productPrice.includes(userInput)) {\n          products[i].style.display = \'block\';\n        } else {\n          products[i].style.display = \'none\';\n        }\n      }\n    });\n  </script>\n\n</body>\n\n</html>');
