\"1\" stop-color=\"#fff\" stop-opacity=\"0\"></stop>\n</linearGradient>\n</defs>\n</svg>\n</p>\n</div>\n\n<div class=\"plan new-plan-mine2 new-plan--360 item-03 no-in-trial plan-360 \" style=\"display: block;\" id=\"\">\n<div class=\"new-plan__wrapper new-plan__wrapper--360 \">\n<p class=\"new-plan__economy\">\n<a href=\"Free-Whonix-VPS-and-hosting-trial.html#clearnet_server\" target=\"_blank\">Details</a>\n</p>\n<a class=\"new-plan__buy new-plan__buy--not-buy button button_buy\" target=\"_blank\" href=\"Contact-free-Whonix-VPS-and-hosting-trial.html\" style=\"background-color: cornflowerblue;\">\n<span class=\"new-plan__buy-text\">Contact us to order</span>\n<svg width=\"19\" height=\"14\" viewBox=\"0 0 19 14\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\">\n<path fill-rule=\"evenodd\" clip-rule=\"evenodd\" d=\"M2.23114 0.375H16.769C17.564 0.375 18.2084 1.08388 18.2084 1.95833V7.5H16.6251V5.91667H2.37508V11.4583H9.50008V13.0417H2.23114C1.43619 13.0417 0.791748 12.3328 0.791748 11.4583V1.95833C0.791748 1.08388 1.43619 0.375 2.23114 0.375ZM16.6251 1.95833V4.33333H2.37508V1.95833H16.6251ZM11.0834 11.4583H14.7138L13.6903 12.4819L14.8099 13.6014L17.7447 10.6667L14.8099 7.73186L13.6903 8.85144L14.7138 9.87498H11.0834V11.4583Z\" fill=\"white\"></path>\n</svg>\n</a>\n</div>\n</div>\n\n<!-- supported-payments-methods   -->\n\n</div>\n<div class=\"support-payments-methods\">\n<p class=\"support-payments-methods__title\">Supported payment methods: a lot of cryptocurrencies</p>\n<div class=\"support-payments-methods__methods\">\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n<span class=\"support-payments-methods__method\">\n</span>\n</div>\n<p class=\"support-payments-methods__doubts\">\n<span>Have doubts ?</span>\n<a href=\"Request-free-Whonix-VPS-and-hosting-trial.html\" target=\"_blank\"><span class=\"support-payments-methods__doubts-contact\">Send us a message!</span></a>\n</p>\n</div>\n</div>\n</div>\n</section>\n\n<!--  why  -->\n\n<section class=\"section section_white section_why-whoer\">\n<div class=\"section__wrapper\">\n<div class=\"section__content container\">\n<div>\n<h2><b>Why choose Whonix VPS & hosting?</b></h2>\n<div class=\"reasons\">\n<ul class=\"reasons__list\">\n<li id=\"Free-trial\">\n<div class=\"reason__icon reason__icon_1\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nFree trial\n</div>\n<div class=\"descr__text\">\nWe provide free trial, so before buying you can test the servers and check if they are really such as we describe them. You have time and possibility to work a little on them and check everything. You will see yourself how much RAM and disk space do they have, what installed on them, do they really have Whonix-16 preinstalled? Do they really have 10 web sites preinstalled? You will run upgrade and can see how quickly it installs upgrades. You can check if it has SSD or HDD disk. And so on. For not educated users we provide clear instructions how to check our servers.\n</div>\n\n</div>\n</li>\n<li id=\"no_analogs\">\n<div class=\"reason__icon reason__icon_2\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nYou can not find another VPS or hosting provider who offers you fully preconfigured Whonix Gateway and Workstation servers.\n</div>\n<div class=\"descr__text\">\nThere is no any VPS or hosting provider who offers Whonix-16 servers. You can get them only from us.\n</div>\n\n</div>\n</li>\n<li id=\"no_need_skills\">\n<div class=\"reason__icon reason__icon_3\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nNearly nothing needed to do if you want just to host .onion web sites. With us no need of skills or education to run your own web site. \n</div>\n<div class=\"descr__text\">\nIf you buy some another VPS, you would 2 months install and configure everything yourself. But we have fully preinstalled and preconfigured .onion web hosting on Whonix-Workstation for 10 web sites with PHP and HTTPS. Deploy your 10 web sites without any Linux IT skills - just insert your web sites in the web server directory and they are immediately online.<br><br>\nEven our free client support can assist with placing your websites, in case if you have tried to do it but have not managed yourself.\n</div>\n\n</div>\n</li>\n<li id=\"10_web_sites\">\n<div class=\"reason__icon reason__icon_8\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\n10 web sites are already running both as HTTP and HTTPS and web server, php server and HTTPS are preinstalled and preconfigured on the servers which you would get from us. \n</div>\n<div class=\"descr__text\">\nAfter you request free trial from us, we would send you ssh credentials to the both servers. And also we would give you 10 onion addresses of the web sites which are already running on the servers you get from us.<br><br> \nFirst you would get in into Whonix-gateway and check there in /var/lib/tor/ directory that these onion websites are really on your server. Then you would open in torbrowser all these 10 onion websites both as HTTP and HTTPS and see if they really online.<br><br> \nBut they are for now just simple pages displaying something like \"Hi. This is my first web site!\" Then you make SSH connection from your Whonix-gateway to your Whonix-workstation and place in the Whonix-workstation in the web server directory your own web sites instead of those simple pages. After that just reload the web sites in your torbrowser and you see your own web sites online.<br><br>\nOur free client support can assist with placing your websites, in case if you have tried to do it but have not managed yourself.\n</div>\n\n</div>\n</li>\n<li id=\"your_anonymity\">\n<div class=\"reason__icon reason__icon_5\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nYour perfect privacy, security and anonymity on the Internet\n</div>\n<div class=\"descr__text\">\nWe are just hidden service, we are not any company. We do not check what are you doing and we do not check content of your web sites.<br><br>\nWe do not require your any personal information for free trial or purchases. For us just your email is enough and it can be email from anonymous email provider. For full anonymity we recommend you to use onion email and fresh email account which you have not used for another activities. This email we use as your username.<br><br> \nWe accept payment just in cryptocurrencies directly to our wallet and only to fresh not used before by somebody payment address without balance on it.<br><br> \nSo we do not know and do not want to know who are you. Nobody will be able to connect your activity on the Internet with your real IP address and real identity - all your actions are anonymous. With us you are protected from possible surveillance and data leakage. Even when adversary with court order require from us any information, we have nothing to give out - we know just your email and nothing more.<br><br> \nYour anonymity is 100% depends on you. If you yourself make mistake like using clearnet email address, adversary would know your IP address and that you have written to us, so maybe you have VPS or hosting with us. Even worse if you have written us without GPG encryption - the adversary may capture your email on the way and read it. If you do not make any mistakes, you are 100% safe with us.<br><br>\nNobody, even you, even any our client using our VPS never knows server`s whereabouts and external IP address, because firewall on our big server allows your Whonix-gateway connections only via tor. \n</div>\n</div>\n</li>\n\n<li id=\"High_performance\">\n<div class=\"reason__icon reason__icon_2_11\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nHigh performance servers without overselling and overloading. Fastest SSD storage and fastest encrypted SSD swap with shreding on stop. Plenty of RAM and swap.\n</div>\n<div class=\"descr__text\">\nOur big server has most modern hardware, including newest processor, fastest DDR4 RAM and superfast 10Gb network connection. But you should take in account that our firewall allows only connections via tor for your VPS, so connections speed in your VPS will be speed of tor.<br><br>\nYou always have dedicated RAM, swap and CPU on your VPS, because we never use memory ballooning on our servers. How much memory and swap is declared for your VPS - it is all the time all yours. You can check it with Linux utilities, as example with command free, when you start your free trial.<br><br>\nWe are not any company, but hidden service. That`s why we do not have many clients. When you get VPS from companies, they have thousands and tens of thousands clients, who make huge load on server.  But on our server you have just a few neighbors, so our server is not oversold and not overloaded, what guaranties high performance of your VPS all the time.<br><br>\nOn our VPS servers we use just fastest SSD both for storage and for swap. Our swap is encrypted with military grade standard encryption and is shreded 10 times when VM or swap itself is stopped. We give plenty of RAM and swap on the second server starting from free trial and you can request our free client support to add swap for free, both on Whonix-gateway and on the second server, if we see a reason and possibility to do this - if you have installed something RAM consuming and we see that most of RAM and swap on your VPS is used. You can always request adding RAM, but this is for extra payment.\n</div>\n</div>\n</li>\n\n<li id=\"DDOS_protection\">\n<div class=\"reason__icon reason__icon_6\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nDDOS protection.\n</div>\n<div class=\"descr__text\">\nWe run anti DDOS protection software on our server.\n</div>\n</div>\n</li>\n\n<li id=\"any_os\">\n<div class=\"reason__icon reason__icon_2_9\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nPossibility to order from us any operating system you want.\n</div>\n<div class=\"descr__text\">\nFor now for free trial just Whonix-workstation or Debian are available as the second server, but when purchasing you can write us which OS you want on the second server and we can install it for you if it is operating system which is installable on our server, but it would cost a little more.\n</div>\n</div>\n</li>\n\n<li id=\"clearnet_server\">\n<div class=\"reason__icon reason__icon_7\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nPossibility to order from us a clearnet server.\n</div>\n<div class=\"descr__text\">\nNormally, we provide always 2 servers together, one of which is Whonix-gateway, and firewall on our big server allows your Whonix-gateway connections only via tor. And second server has connections only via Whonix-gateway. But when you make a special order, we provide for you a clearnet server, which has direct connection to outside world and external IP address.<br><br>\nWe do not write any characteristics of the server, because we have hundreds of options for you. We build it according your needs. So you should describe us how much RAM, disk space, how many vCPUs do you need, do you require SSD or is HDD okay fo you, do you require virtual machine or is container okay fo you and so on. Good is you describe a purpose you buy VPS for.<br><br> \nAs example, if you write that you need VPS for openvpn server, we would understand, that it should be much RAM, many CPU cores, processor should have more GHz and support AES-NI, if there are many users, then as minimum gigabit internet is required, but very small disk space is needed. Even better, when you describe us how many users will be on your openvpn server, we would calculate how much RAM, CPU cores and traffic should your VPS have exactly.<br><br>\nAnother example, when you write us that you need VPS for backups of another server, then again we understand that it should be server with big disk space, but with less RAM and CPU. Here again we can calculate exactly, if you give us detailed information.<br><br>\nJust after that we write you all characteristics of the server you are going to get from us and the price based on this calculations. Our price is never higher than other VPS providers`. You pay us 100% anonymously with crypto and after that we build VPS for you! You get your VPS next day after your payment.<br><br>\nThere are so many VPS providers in the World, so why would you order clearnet server from us? Because there are a few huge differences when you purchase from us. First huge difference - you purchase from us 100% anonymously over tor without giving us any your personal information and paying 100% anonymously with cryptos.<br><br> \nSecond huge difference - another provider just sells you VPS and you should do everything yourself on it, but when you purchase from us, for small extra payment our IT specialist does whatever you desire on your server. For little extra payment we install for you OS which you want and any software and programs according to your wishes.<br><br>\nWe can sell you VPS with open port 25 also. On our usual VPS we also never block port 25, but because connection always goes through tor, it is tor relays who blocking port 25. If you find tor relay with open port 25 and can configure tor on Whonix-gateway via that relay, you can use port 25 on our usual VPS also. For a little extra payment we can setup tor relay with open port 25 for you.<br><br>\nWe do not provide trial for clearnet servers.\n</div>\n</div>\n</li>\n\n<li id=\"dedicated_server\">\n<div class=\"reason__icon reason__icon_7\"></div>\n<div class=\"reason__descr\">\n<div class=\"descr__titile\">\nPossibility to order from us a dedicated server.\n</div>\n<div class=\"descr__text\">\nYou can order from us a fully dedicated baremetal server with 200GB - 10TB storage and 8GB - 128GB RAM.<br><br>\nWe do not write any characteristics of the server, because we have hundreds of options for you. We build it according your needs. So you should describe us how much RAM, disk space, how many CPU cores and threads do you need, do you require SSD or is HDD okay fo you, and so on.<br><br>\nJust after that we write you all characteristics of the server, which looks suitable your demands and the price. Our price is never higher than other dedicated baremetal server providers`. You pay us 100% anonymously with crypto and after that we build dedicated baremetal server for you! You get your dedicated baremetal server next day after your payment.<br><br>\nThere are so many dedicated server providers in the World, so why would you order dedicated server from us? Because there are a few huge differences when you purchase from us. First huge difference - you purchase from us 100% anonymously over tor without giving us any your personal information and paying 100% anonymously with cryptos.<br><br> \nSecond huge difference - another provider just sells you server and you should do everything yourself on it, but when you purchase from us, for small extra payment our IT specialist does whatever you desire on your server. For little extra payment we install for you OS which you want and any software and programs according to your wishes.<br><br>\nThird huge difference - another provider gives you a list of a few operating systems to choose from