(35, 'beretta', 0, 'http://kruoj37vvqmp4tsb3gulpcdj2pjw2vk7ta7edfoqvb4ow352xiivunid.onion', 'not active link'),
(36, 'beretta', 0, 'http://owwcs2gh72stepbn5pubbgp7wiiosgxva55goloulqcuwc5kieshevyd.onion', '<html><head>\n<meta http-equiv=\"content-type\" content=\"text/html; charset=UTF-8\">\n        <title>Firearms 72</title>\n        <link rel=\"stylesheet\" type=\"text/css\" href=\"mystyle.css\">\n        <meta name=\"keywords\" content=\"firearms72, firearms, fire, arms, weapon, gun, firegun, ammo, bullet, buy, serial, number, hidden gun, glock, p320, beretta, cz 75, kimber, micro, 9, colt, ar15, ar, assult, rifle, diamondback, db15\">\n        <meta name=\"description\" content=\"Firearms 72 Deepweb Firearms Vendor. You can find many different guns and ammo types here.\">\n        <meta name=\"keywords\" content=\"rossi, circuit, judge, ruger, ar556, precision, hunting, tactical, riflescope, scope, awp, springfield, saint, 5.56, nato, 308, 9mm, 115grain, rounds, cartridge\">\n    </head>\n    <body>\n        <div id=\"header-area\">\n            <div id=\"title-area\">Firearms<span class=\"b700ff\">72</span></div>\n        </div>\n        <div id=\"msg\">\n          <p>Welcome to firearms72 Deep Web Weapon Shop!          </p>\n          <p>Use the order form or email us for order! <br>\n            <span class=\"contact\">Firearmz@dnmx.org</span><br>\n            Some stupid person asked for a gun, and a photo with lighter to prove reality,<br>\n            then deleted his e-mail address and now spreading false information.<br>\n            Here is the photo with the lighter you stupid sick bastard. Stop spreading false information!<a href=\"1911-lighter.png\" target=\"_blank\">HERE</a> </p>\n        </div>\n          \n        <div id=\"content\">\n            <div class=\"cat\">\n                <div class=\"cat-name\">Handguns</div>\n                <div class=\"prod-area\">\n                    <div class=\"product\">\n                        <div class=\"prod-left\">\n                                <div class=\"prod-pic\"><img src=\"glock-g26-gen4.jpg\"></div>\n                                <div class=\"prod-price\">0.016 BTC </div>\n                        </div>\n                            <div class=\"prod-right\">\n                            <div class=\"prod-name\">Glock G26 GEN4</div>\n                            <div class=\"prod-desc\">The GLOCK 26 Gen4 in 9\n mm Luger is one of the most sought-after concealed carry pistols. \n                            The magazine capacity of 10 rounds is \nstandard and the highly accurate firing characteristics explain why \n                            the G26 Gen4 is the mainstay backup option \namong security personnel and agencies worldwide. Of course, the \n                            G26 Gen4 comes with a reversible magazine \ncatch, interchangeable back straps and improved frame texturing \n                            for solid control despite the pistol’s size.</div>\n                            <div class=\"gunivore-link\"><a href=\"Shipping.html\" target=\"_blank\">\n                              <button>Order</button></a></div>\n                        </div> \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"sig-sauer-p320.jpg\"></div>\n                                    <div class=\"prod-price\">0.016 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Sig Sauer P320</div>\n                                <div class=\"prod-desc\">If you haven’t \nheard of Sig Sauer’s P320 yet then I don’t know where you’ve been for \n                                    the last year. As one of the \nbest-selling guns in America, the new and improved Sig pistol is \nsweeping \n                                    the nation thanks to its incredible \nversatility, durability, and accuracy. In fact, it was just this \n                                    January that the P320 won the \nlong-awaited and highly-anticipated U.S. Military Handgun Competition.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>    \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"beretta-96a1.jpg\"></div>\n                                    <div class=\"prod-price\">0.016 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Beretta 92A1</div>\n                                <div class=\"prod-desc\">Beretta firearms \nare among the most popular in the world, and their handguns shine \nbrightest \n                                    in what is an undoubtedly impressive\n catalog. Some of their most popular semi-auto handguns are found in the\n 92 \n                                    series. Production of these weapons \nbegan in 1972 and while they were impressive upon release, they have \nonly \n                                    been improved upon since.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"cz-usa-cz-75.jpg\"></div>\n                                    <div class=\"prod-price\">0.016 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">CZ-USA CZ 75</div>\n                                <div class=\"prod-desc\">The CZ-75 is one \nof the most successful handguns in modern history but it wasn’t easy to \nget \n                                    to the top. CZ is one of the top \nfirearms producers in Europe and has been for nearly 100 years. The \nCzech arms \n                                    manufacturer was established \npost-World War II but never saw international success until the fall of \nthe Soviet \n                                    Union. In fact, this handgun wasn’t \neven available in the U.S. until several years into its production. \nSimilarly, \n                                    the Iron Curtain was tremendously \ndetrimental to the CZ-75’s success thanks to the strict limits imposed \nby the Warsaw Pact.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"kimber-micro-9.jpg\"></div>\n                                    <div class=\"prod-price\">0.016 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Kimber Micro 9</div>\n                                <div class=\"prod-desc\">This is a company\n known for its 1911-style pistols, but that is not the be-all and \nend-all of \n                                    this gun manufacturer. Not everyone \nis a fan of that gun or its style, which is why Kimber offers pistols, \nrifles, \n                                    and even a revolver, all in \ndifferent configurations and style options. Still, they are probably \nbest known for their 1911s.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping.html\" target=\"_self\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                </div>\n            </div>\n\n            <div class=\"cat\">\n                <div class=\"cat-name\">Rifles</div>\n                <div class=\"prod-area\">\n                    <div class=\"product\">\n                        <div class=\"prod-left\">\n                                <div class=\"prod-pic\"><img src=\"colt-ar-15.jpg\"></div>\n                                <div class=\"prod-price\">0.039 BTC </div>\n                        </div>\n                            <div class=\"prod-right\">\n                            <div class=\"prod-name\">Colt AR15</div>\n                            <div class=\"prod-desc\">The Colt AR-15 is a \nlightweight, 5.56×45mm, magazine-fed, gas-operated semi-automatic rifle.\n \n                                It was designed to be manufactured with \nextensive use of aluminum alloys and synthetic materials. It is a \nsemi-automatic \n                                version of the United States military \nM16 rifle that is marketed to civilian and law-enforcement customers.</div>\n                            <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                              <button>Order</button></a></div>\n                        </div> \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"diamondback-firearms-db15.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Diamondback Firearms DB15</div>\n                                <div class=\"prod-desc\">Known for its reliability, the Diamondback Firearms DB15 Semi Auto Rifles are great for hunting and target shooting.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>    \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"kel-tec-sub-2000.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Kel-Tec Sub-2000</div>\n                                <div class=\"prod-desc\">This weapon is a \nmarvel of function and portability but is a little rough around the \nedges straight from the factory. \n                                        Kel-Tec has made a name for \nitself in the gun industry as an innovative company.  They aren’t afraid\n to try new firearms ideas.\n                                        Tapping into the current trend \nof pistol caliber rifles, Kel-Tec jumped in feet first with the Sub \n2000—a modern day Transformer.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"rossi-circuit-judge.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Rossi Circuit Judge</div>\n                                <div class=\"prod-desc\">\n                                        The Rossi Circuit Judge® is \nversatility at its finest. Based on the legendary Taurus Judge® \nrevolver, this powerful rifle has the ability \n                                        to fire both 410 shotshells and \n45 Long Colt ammunition without changing cylinders or barrels. Whether \nfor home defense, hog hunting or \n                                        plinking, the Circuit Judge will\n quickly become your go-to gun.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"ruger-10-22.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Ruger 10/22</div>\n                                <div class=\"prod-desc\">This legendary \naction is a tried and true Ruger design that ensures consistent, \nreliable performance.\n                                        Easy-to-use, prominent magazine \nrelease provides smooth, no-fuss removal of flush-mounted magazine.\n                                        Cold hammer-forged barrel is \nlocked into the receiver by a unique, two-screw, V-block system.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"ruger-ar-556.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Ruger AR556</div>\n                                <div class=\"prod-desc\">Ruger® Rapid \nDeploy folding rear sight provides windage adjustability and pairs with \nthe A2-style, F-height, elevation-adjustable \n                                    front sight for a solid, reliable \naiming system. Made from 7075-T6 hard-coat anodized aluminum forgings, \nshot-peened and proof-tested 9310 steel bolt, \n                                    and 8620 steel bolt carrier. The \ninside diameter of the carrier and gas key are chrome plated and the key\n is staked for longevity.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"ruger-precision.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Ruger Precision</div>\n                                <div class=\"prod-desc\">Equipped with a \nfactory-installed Vortex® Diamondback® Tactical 4-12x40 riflescope with a\n 1\" tube and a VMR-1(MOA) Reticle. Scope features \n                                    exposed tactical turrets built for \ndialing elevation and windage, allowing quick and precise bullet drop \nand wind drift compensation at extended ranges.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                    <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"springfield-saint.jpg\"></div>\n                                    <div class=\"prod-price\">0.039 BTC </div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">Springfield Saint</div>\n                                <div class=\"prod-desc\">When it comes \ntime to defend your legacy, turn to the SAINT™. It’s the ultimate \nrefinement of the time-tested AR15 design and represents \n                                    everything that a defensive carbine \nshould be. Introducing new M-LOK compatible SAINT rifles chambered in \n5.56mm NATO. These SAINT rifles now feature slim \n                                    M-LOK compatible handguards from \nBravo Company, with an internal aluminum heat shield.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div>     \n                    </div>\n                </div>\n            </div>\n<div align=\"center\"><a href=\"http://tornode3tnrtzgqwd3vmxdumucddqfd6zk7icu4wzdwxo5c3zn2xqfqd.onion/\" target=\"_blank\"><img src=\"TorNode_banner.png\" width=\"350\" height=\"45\" border=\"0\"></a></div>\n          \n          \n            <div class=\"cat\">\n                    <div class=\"cat-name\">Ammo</div>\n                    <div class=\"prod-area\">\n                        <div class=\"product\">\n                            <div class=\"prod-left\">\n                                    <div class=\"prod-pic\"><img src=\"tulammo.png\"></div>\n                                    <div class=\"prod-price\">0.005</div>\n                            </div>\n                                <div class=\"prod-right\">\n                                <div class=\"prod-name\">5.56 NATO 55 GR FMJ 100 Round Case</div>\n                                <div class=\"prod-desc\">If you are a high\n volume shooter, this is the ammo for you. This cartridge uses a \nnon-corrosive Berdan primer and bullets with a lead core \n                                    and full bimetal jacket. The steel \ncase has is bottled-shaped with non-projecting flange and a phosphate \npolymer coating.</div>\n                                <div class=\"gunivore-link\"><a href=\"Shipping-72.html\" target=\"_blank\">\n                                  <button>Order</button></a></div>\n                            </div> \n                        </div>\n                        <div class=\"product\">\n                                <div class=\"prod-left\">\n                                        <div class=\"prod-pic\"><img src=\"308.jpg\"></div>\n                                        <div class=\"prod-price\">0.005 BTC </div>\n                                </div>\n                                    <div class=\"prod-right\">\n                                    <div class=\"prod-name\">308 - 150 Grain FMJ - Tula - 200 Rounds</div>\n                                    <div class=\"prod-desc\">This newly \nmanufactured ammunition is PERFECT for target practice, range training, \nor plinking. It is both economical and reliable and \n                                        is produced by one of the most \nestablished ammunition plants in the world.</div>\n                                    <div class=\"gunivore-link\"><a href=\"Shipping-72.html\" target=\"_blank\">\n                                      <button>Order</button></a></div>\n                                </div>    \n                        </div>\n                        <div class=\"product\">\n                                <div class=\"prod-left\">\n                                        <div class=\"prod-pic\"><img src=\"9mm.jpg\"></div>\n                                        <div class=\"prod-price\">0.005 BTC </div>\n                                </div>\n                                    <div class=\"prod-right\">\n                                    <div class=\"prod-name\">9mm - 115 Grain FMJ - Tula - 100 Rounds</div>\n                                    <div class=\"prod-desc\">This newly \nmanufactured 9mm ammunition is PERFECT for target practice, range \ntraining, or plinking. It is both economical and reliable \n                                        and is produced by one of the \nmost established ammunition plants in the world.</div>\n                                    <div class=\"gunivore-link\"><a href=\"Shipping-72.html\" target=\"_blank\">\n                                      <button>Order</button></a></div>\n                                </div>    \n                        </div>\n                    </div>\n          </div>\n        </div>\n\n\n        <div id=\"lst\">\n            <div class=\"warning\">\n                WARNING\n            </div>\n            <div class=\"war-msg\">\n                All of the firearms listed above are clean and their serial numbers have been erased.<br>\n                No one will be able to trace back those weapons and they\n are safe to use for hunting, self defence, or, you know..<br>\n                If you don\'t know what weapon is best for your needs, send an e-mail and we will make a recommendation.<br><br>\n                All the weapons will be sent ASSEMBLED with a private courier. No mail registrations.<br>\n                Worldwide Shipping excluding the following countries: \nNorth Korea, Sudan, Tunisia, Algeria, Egypt, Iran, Iraq, Syria, Umman, \nParaguay<br><br>\n                LEGAL NOTICE: firearms72 can not be held responsible from individual customers\' actions.\n            </div>\n            <div id=\"lst-t\">Firearmz@dnmx.org</div>\n        </div>\n    \n</body></html>\n');
