d\" />\n          <input type=\"hidden\" value=\"1\" class=\"form-control quantity\" />\n          <div class=\"form-group\">\n            <button class=\"btn add-to-cart\"><i class=\"fa fa-shopping-cart fa-lg\" style=\"margin-right: 15px;\"></i>Add to Cart</button>\n          </div>\n        </form>\n        <a class=\"btn btn-dark\" role=\"button\" href=\"telescopic-baton-hardened-steel.php\" style=\"border-style: none;border-color: var(--bs-dark);font-size: 13px; color: var(--bs-gray-100);width: 166px;height: 40px;padding-top: 8px;padding-top: 10px;\">More information&nbsp;<i class=\"fas fa-angle-double-right\" style=\"padding-top: 2px;\"></i></a> </div>\n    </div>\n  </div>\n</section>\n<section id=\"faq\" style=\"padding-bottom: 0px;\">\n  <div class=\"row\" style=\"text-align: center;margin-bottom: 100px;\">\n    <div class=\"col\"><img src=\"assets/img/divider.jpg\"></div>\n  </div>\n  <div class=\"container\" style=\"margin-bottom: 150px;\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"text-uppercase\">FAQ</h2>\n        <h3 class=\"text-dark section-subheading\" style=\"font-size: 20px;\">Check out the most popular questions from our customers</h3>\n        <button class=\"accordion-list\" >Why are you selling weapons on the Darknet?</button>\n        <div class=\"panel\">\n          <p>The law in most countries forbid possession of guns by civilians. You cannot go to a local gun store and buy a weapon without license. The only way to get armed is to order guns illegally from a trusted source. Buying your gun from Tor Guns is 100% safe. We only operate on the Darknet and we don\'t reveal your identity to authorities. We also do our best to mask real content of package. All information you provide are strongly encrypted and stored only for the time of processing your order.</p>\n        </div>\n        <button class=\"accordion-list\">Are your guns new or used?</button>\n        <div class=\"panel\">\n          <p>The guns we sell are new or used in very good condition.</p>\n        </div>\n        <button class=\"accordion-list\">To which countries do you ship your products?</button>\n        <div class=\"panel\">\n          <p>We ship worldwide except Afghanistan, Algeria, Egypt, Iran, Iraq, North Korea, Paraguay, Sudan, Syria, Tunisia.</p>\n        </div>\n        <button class=\"accordion-list\">How safe is it to buy from you?</button>\n        <div class=\"panel\">\n          <p>If you order to an EU country, we give you 100% guarantee of safe delivery to specified place because there are no border controls.<br>\n            Delivery to countries outside the EU zone entails the risk of customs control. We do our best to reduce this risk. We use a good stealth to avoid detection. Pistols are taken apart and hidden inside children\'s toys etc. Rifles are taken apart and shipped within bigger appliances.<br>\n            You will receive an instruction manual via e-mail on how to assemble the weapon.\n            If there is a delivery delay and you suspect that the package is stuck in customs, you must contact us immediately. </p>\n        </div>\n        <button class=\"accordion-list\">Which weapon is best suited for beginners?</button>\n        <div class=\"panel\">\n          <p>If this is your first gun purchase, we can recommend the <a href=\"#pistols\"><span style=\"color: #fece18\">Glock 17 or 19</span></a> which are very easy to handle and are also very effective.</p>\n        </div>\n		  <button class=\"accordion-list\">Why is it not possible to only buy ammo?</button>\n        <div class=\"panel\">\n          <p>Since the shipping cost including packaging costs significantly more than our product price, we only sell ammunition together with gun purchases. If you plan to buy larger quantities of ammunition, contact us for a quote.</p>\n        </div>\n        <button class=\"accordion-list\">How do I pay for your products?</button>\n        <div class=\"panel\">\n          <p>At the moment we only accept payment with Bitcoin or Monero.</p>\n        </div>\n        <button class=\"accordion-list\">How do I buy Bitcoin or Monero?</button>\n        <div class=\"panel\">\n          <p>You can buy Bitcoin and Monero from several major exchanges such as <a href=\"https://www.coinbase.com\" target=\"_blank\"><span style=\"color: #fece18\">Coinbase</span></a> | <a href=\"https://www.binance.com\" target=\"_blank\"><span style=\"color: #fece18\">Binance</span></a> | <a href=\"https://www.kucoin.com\" target=\"_blank\"><span style=\"color: #fece18\">KuCoin</span></span></a> | <a href=\"https://www.kraken.com\" target=\"_blank\"><span style=\"color: #fece18\">Kraken</span></a> | <a href=\"https://localbitcoins.com\" target=\"_blank\"><span style=\"color: #fece18\">LocalBitcoins</span></a></p>\n        </div>\n        <button class=\"accordion-list\">Can I pay by credit card or Paypal?</button>\n        <div class=\"panel\">\n          <p>Sorry, for security reasons we only accept payment with Bitcoin or Monero.</p>\n        </div>\n        <button class=\"accordion-list\">Can I pay after delivery?</button>\n        <div class=\"panel\">\n          <p>Sorry, we only accept payment in advance before delivery.</p>\n        </div>\n        <button class=\"accordion-list\">Do you offer payment via Escrow?</button>\n        <div class=\"panel\">\n          <p>Unfortunately, legal Escrow companies do not accept the sale of illegal weapons, and they refuse to pay the deposited amount with reference to illegal services being sold. <br>\n            <strong>Note:</strong> Do not ask us questions about using an Escrow service on the Darknet, they are in most cases scams.</p>\n        </div>\n        <button class=\"accordion-list\">How to avoid getting caught?</button>\n        <div class=\"panel\">\n          <p>The risk of getting caught when you buy guns from us is non-existent.<br>\n            We encrypt all customer information and also delete it as soon an order has been dispatched.<br>\n            We send all products well hidden in innocent shipments such as children\'s toys etc.<br>\n            <br>\n            Follow these rules for additional security:<br>\n          <ul>\n            <li>Always use the latest version of TOR Browser <a href=\"https://www.torproject.org/download\"><span style=\"color: #fece18\">https://www.torproject.org/download</span></a></li>\n            <li>Never order weapons for your workplace.</li>\n            <li>Never talk to anyone about your activities on the Darknet.</li>\n          </ul>\n          </p>\n        </div>\n        <button class=\"accordion-list\">How long is the delivery time?</button>\n        <div class=\"panel\">\n          <p>Standard shipping is included in all prices and takes 3 - 10 business days depending on destination.<br>\n            Express shipping costs $30 and takes 2 - 4 business days depending on destination. </p>\n        </div>\n        <button class=\"accordion-list\">Is there any return policy?</button>\n        <div class=\"panel\">\n          <p>We offer a full money-back guarantee for all purchases made in our store. <br>\n            If you are not satisfied with the product that you have purchased from us, you can get your money back. <br>\n            You are eligible for a full reimbursement within 14 calendar days of your purchase.</p>\n        </div>\n        <button class=\"accordion-list\">What happens if my package gets stuck in customs?</button>\n        <div class=\"panel\">\n          <p>If your package gets stopped in customs and confiscated please contact us, we will either refund or reship (your choice).</p>\n        </div>\n        <button class=\"accordion-list\">Can I receive a discount on my order?</button>\n        <div class=\"panel\">\n          <p>For larger orders we provide an individual discount, contact us for further information at <span style=\"color: #fece18\"> richard.j@freedommail.io</span></p>\n        </div>\n        <button class=\"accordion-list\">How do I contact you?</button>\n        <div class=\"panel\">\n          <p>You as a customer are important to us and we will answer any questions you may have via our email: <span style=\"color: #fece18\"> richard.j@freedommail.io</span></p>\n        </div>\n        <button class=\"accordion-list\">Do you have a Public Key?</button>\n        <div class=\"panel\">\n          <p> Yes, below you will find our Public key if you want to send us an encrypted message.</p>\n          <pre>\n  -----BEGIN PGP PUBLIC KEY BLOCK-----\n\nmQINBGM2syMBEADJ1/8N9psyvKNl7Vbwfsm/NiORutGqonEAaomXKz0ydFL5bDDJ\nSsoamycxn7E9h46BW7DzhPfsuPlehMU/nZ8pmshNme3F9QZkvJjdt7cFprKokV0G\nA7BTkoYBpM8P5+qjcvU5iBdtBEiq8LPbYuh30VrUO5qWND8rmfTVA4aLJ/sPNHcs\nRTfD3v1QV8upPyxYgCwln5IG7WkMpJPxzLpn12EfvqX+znUff7jCOna6LrH5DzW4\njLuZrYAI5QDBk5oLu+CtnIfkAYgrjAfdK8mm2USaw3dAW8xpqHhj2ix66QlvrRYy\nZMsJSio3zEAdFKtt0YTN6LpjBmiFM+e+hvoErFRz/xu6laU+nkExjPKXLVRp0Fji\n5E7+EYXk8C0cjy3qGQu0Gs3Rviu2TR3bMzPBeA90KOs+2vq/yckE2HufZkcU2adj\n6EovWJFRyRTnvoYAIdwvbS6JacqrvnJpJR+Wq+Gmx7dDo1SUDxmaPpLJ0LOlC22A\nXMXcsYECH/JUsbctLrWHL39M+AXQJeqQIAZqSOn1kqhhylQ0DCI2puBzYuEUA3EU\niBzuFRbuK0wf1uKVfhc/RhrWSkO0SR1LZyg+F9aW4GXSU5ZE+SUQ+QflsFbnGAHy\nawTeMT+x0GO4Yh2vB1+nyH1LS57UVyVn5XtC4ZAlEmSOkq8j+j2vznOzbwARAQAB\ntCNUT1IgR1VOUyA8cmljaGFyZC5qQGZyZWVkb21tYWlsLmlvPokCVAQTAQgAPhYh\nBCdwGiR2X29zevoActI4PuRncGR7BQJjNrMjAhsDBQkHhh+ABQsJCAcCBhUKCQgL\nAgQWAgMBAh4BAheAAAoJENI4PuRncGR74I0P/0rvSiDYwKzylxR0roHwh50+WQyx\nGIB+EMhOHuw/Hu7hU5MD0OvT1GynrrP5KzaDTxYRUldqMFIz392TqT8/oFOtihg/\n0BKzh0XZqEpb+pHay4owU2ISnF26wgPr1d9vKU7370NYxQHtV6t6jvjAkQpq4x5r\n8lyAwZw4NAY3I5UnaKGlFBsOhnQDXmLfsXUoN14xWGOX6qGTDaB8Nu3MDfvnrdaD\nC2kkCfnL9lpyxeVNsIvke/qNCFwFq8gsWnSYF0Mw5PEGUJCmIhwz0Bwd1PPYraet\npDNJIKrJDsD+AqYfhlRsR2D8+vp+ruaPuHj6ElVgnNynUjOtC6JVWS+cAyIdIis7\n2bM9wZtTJLiJZmufmhuJM4DQTO1YF5ZucAK8YzdOEQFK8PUEMGenexfxQAHknbt0\nVIRZZSI2fNiRLNK4WJRuK7qu939lqzCMBW+DQX371p3/cTDyfKE+EpWei4eAxpmz\nDUj2NdkfyGoorAVqIQU